import React from 'react';

import './styles.css';
import logo_img from '../../assets/logo.svg';

export default function Register(){
    return (
        <div className="register-container">
            <div className="content">
                <section>
                    <img src={logo_img} alt="Be The Hero"/>
                </section>
                <form></form>
            </div>
        </div>
    );
}
